import { StyleSheet, Text, View } from 'react-native';
import { Doughnut } from 'react-chartjs-2';

const data2={
    labels: ['Jun', 'Jul', 'Aug'],
    datasets: [
      {
        id: 1,
        label: '',
        data: [5, 6, 7],
      },
      {
        id: 2,
        label: '',
        data: [3, 2, 1],
      },
    ],
}

export default function Home(){

    return(
        <View style={styles.container}>
            <Text>Home</Text>
            <Doughnut data={data2} />
        </View>
    );
}

const styles = StyleSheet.create({
    container:{
        flex: 1,
        justifyContent: 'center'
    }
});
